funcReserve:
  function funcReserve() {
    log("funcReserve");
    
    const tag = localStorage.getItem("TZ_RESERVE");
    if (tag && new Date().getTime() - tag < 1000 * 5) {
      funcEnd();
      return;
    }
    localStorage.setItem("TZ_RESERVE", new Date().getTime());

    TZLOG(logParam, (data) => {
      log(data);
      setTimeout(funcSearch, 1000);
    });
  }

funcSearch:
  function funcSearch() {
    log("funcReserve");

    const els = document.getElementsByClassName("colBlue");
    const dictCourse = {
      11: "EAST",
      22: "WEST",
    };
    const result = [];
    Array.from(els).forEach((el) => {
      const param = el.getAttribute("onclick").inparen();
      const elDate = param[0];
      const elTime = param[2];
      const elCourse = param[1];
      console.log("reserve search", dictCourse[elCourse], elDate, elTime);
      result.push({ date: elDate, time: elTime, course: dictCourse[elCourse] });
    });
    const param = {
      golf_club_id: "88475b10-7c43-11ec-b15c-0242ac110005",
      device_id: "${deviceId}",
      result,
    };
    const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
    post(addr, param, { "Content-Type": "application/json" }, (data) => {
      log(data);
      LOGOUT();
      funcEnd();
    });
  }
